r&amp;quot; href=&amp;quot;#bencher&amp;quot;&amp;gt;\u00b6&amp;lt;/a&amp;gt;&amp;lt;/h1&amp;gt;\n&amp;lt;h2 id=&amp;quot;continuous-integration-status&amp;quot;&amp;gt;Continuous Integration Status &amp;lt;a class=&amp;quot;header-anchor&amp;quot; href=&amp;quot;#continuous-integration-status&amp;quot;&amp;gt;\u00b6&amp;lt;/a&amp;gt;&amp;lt;/h2&amp;gt;\n&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;https://github.com/dyson-ai/bencher/actions/workflows/ci.yml?query=branch%3Amain&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://github.com/dyson-ai/bencher/actions/workflows/ci.yml/badge.svg?branch=main&amp;quot; alt=&amp;quot;Ci&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://codecov.io/gh/dyson-ai/bencher&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://codecov.io/gh/dyson-ai/bencher/branch/main/graph/badge.svg?token=Y212GW1PG6&amp;quot; alt=&amp;quot;Codecov&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://GitHub.com/dyson-ai/bencher/issues/&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://img.shields.io/github/issues/dyson-ai/bencher.svg&amp;quot; alt=&amp;quot;GitHub issues&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://github.com/dyson-ai/bencher/pulls?q=is%3Amerged&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://badgen.net/github/merged-prs/dyson-ai/bencher&amp;quot; alt=&amp;quot;GitHub pull-requests merged&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://pypi.org/project/holobench/&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://img.shields.io/pypi/v/holobench&amp;quot; alt=&amp;quot;PyPI&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://GitHub.com/dyson-ai/bencher/releases/&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://img.shields.io/github/release/dyson-ai/bencher.svg&amp;quot; alt=&amp;quot;GitHub release&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://opensource.org/license/mit/&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://img.shields.io/pypi/l/bencher&amp;quot; alt=&amp;quot;License&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://www.python.org/downloads/release/python-310/&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://img.shields.io/badge/python-3.10%20%7C%203.11-blue&amp;quot; alt=&amp;quot;Python&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;h2 id=&amp;quot;intro&amp;quot;&amp;gt;Intro &amp;lt;a class=&amp;quot;header-anchor&amp;quot; href=&amp;quot;#intro&amp;quot;&amp;gt;\u00b6&amp;lt;/a&amp;gt;&amp;lt;/h2&amp;gt;\n&amp;lt;p&amp;gt;Bencher is a tool to make it easy to benchmark the interactions between the input parameters to your algorithm and its resulting performance on a set of metrics.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;Parameters for bencher are defined using the param library &amp;lt;a href=&amp;quot;https://param.holoviz.org/&amp;quot;&amp;gt;https://param.holoviz.org/&amp;lt;/a&amp;gt; as a config class with extra metadata that describes the bounds of the search space you want to measure.  You must define a benchmarking function that accepts an instance of the config class and return a dictionary with string metric names and float values.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;Parameters are benchmarked by passing in a list N parameters, and an N-Dimensional tensor is returned.   You can optionally sample each point multiple times to get back a distribution and also track its value over time.  By default the data will be plotted automatically based on the types of parameters you are sampling (e.g, continous, discrete), but you can also pass in a callback to customize plotting.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;The data is stored in a persistent database so that past performance is tracked.&amp;lt;/p&amp;gt;\n&amp;lt;h2 id=&amp;quot;assumptions&amp;quot;&amp;gt;Assumptions &amp;lt;a class=&amp;quot;header-anchor&amp;quot; href=&amp;quot;#assumptions&amp;quot;&amp;gt;\u00b6&amp;lt;/a&amp;gt;&amp;lt;/h2&amp;gt;\n&amp;lt;p&amp;gt;The input types should also be of one of the basic datatypes (bool, int, float, str, enum, datetime) so that the data can be easily hashed, cached and stored in the database and processed with seaborn and xarray plotting functions. You can use class inheritance to define hierarchical parameter configuration class types that can be reused in a bigger configuration classes.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;Bencher is designed to work with stochastic pure functions with no side effects.  It assumes that when the objective function is given the same inputs, it will return the same output +- random noise.  This is because the function must be called multiple times to get a good statistical distribution of it and so each call must not be influenced by anything or the results will be corrupted.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;Pseudocode of bencher&amp;lt;/h3&amp;gt;\n&amp;lt;pre&amp;gt;&amp;lt;code&amp;gt;Enumerate a list of all input parameter combinations\nfor each set of input parameters:\n    pass the inputs to the objective function and store results in the N-D array\n\n    get unique hash for the set of inputs parameters\n    look up previous results for that hash\n    if it exists:\n        load historical data\n        combine latest data with historical data\n\n    store the results using the input hash as a key\ndeduce the type of plot based on the input types\nreturn data and plot\n&amp;lt;/code&amp;gt;&amp;lt;/pre&amp;gt;\n&amp;lt;h3&amp;gt;Example Output&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;https://dyson-ai.github.io/bencher/&amp;quot;&amp;gt;https://dyson-ai.github.io/bencher/&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\n"}}]}}}},{"type":"object","name":"TabPanel","id":"p1073","attributes":{"name":"Categorical 1D Example","title":"Categorical 1D Example","child":{"type mp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://GitHub.com/dyson-ai/bencher/releases/&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://img.shields.io/github/release/dyson-ai/bencher.svg&amp;quot; alt=&amp;quot;GitHub release&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://opensource.org/license/mit/&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://img.shields.io/pypi/l/bencher&amp;quot; alt=&amp;quot;License&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;br /&amp;gt;\n&amp;lt;a href=&amp;quot;https://www.python.org/downloads/release/python-310/&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;https://img.shields.io/badge/python-3.10%20%7C%203.11-blue&amp;quot; alt=&amp;quot;Python&amp;quot; /&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\n&amp;lt;h2 id=&amp;quot;intro&amp;quot;&amp;gt;Intro &amp;lt;a class=&amp;quot;header-anchor&amp;quot; href=&amp;quot;#intro&amp;quot;&amp;gt;\u00b6&amp;lt;/a&amp;gt;&amp;lt;/h2&amp;gt;\n&amp;lt;p&amp;gt;Bencher is a tool to make it easy to benchmark the interactions between the input parameters to your algorithm and its resulting performance on a set of metrics.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;Parameters for bencher are defined using the param library &amp;lt;a href=&amp;quot;https://param.holoviz.org/&amp;quot;&amp;gt;https://param.holoviz.org/&amp;lt;/a&amp;gt; as a config class with extra metadata that describes the bounds of the search space you want to measure.  You must define a benchmarking function that accepts an instance of the config class and return a dictionary with string metric names and float values.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;Parameters are benchmarked by passing in a list N parameters, and an N-Dimensional tensor is returned.   You can optionally sample each point multiple times to get back a distribution and also track its value over time.  By default the data will be plotted automatically based on the types of parameters you are sampling (e.g, continous, discrete), but you can also pass in a callback to customize plotting.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;The data is stored in a persistent database so that past performance is tracked.&amp;lt;/p&amp;gt;\n&amp;lt;h2 id=&amp;quot;assumptions&amp;quot;&amp;gt;Assumptions &amp;lt;a class=&amp;quot;header-anchor&amp;quot; href=&amp;quot;#assumptions&amp;quot;&amp;gt;\u00b6&amp;lt;/a&amp;gt;&amp;lt;/h2&amp;gt;\n&amp;lt;p&amp;gt;The input types should also be of one of the basic datatypes (bool, int, float, str, enum, datetime) so that the data can be easily hashed, cached and stored in the database and processed with seaborn and xarray plotting functions. You can use class inheritance to define hierarchical parameter configuration class types that can be reused in a bigger configuration classes.&amp;lt;/p&amp;gt;\n&amp;lt;p&amp;gt;Bencher is designed to work with stochastic pure functions with no side effects.  It assumes that when the objective function is given the same inputs, it will return the same output +- random noise.  This is because the function must be called multiple times to get a good statistical distribution of it and so each call must not be influenced by anything or the results will be corrupted.&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;Pseudocode of bencher&amp;lt;/h3&amp;gt;\n&amp;lt;pre&amp;gt;&amp;lt;code&amp;gt;Enumerate a list of all input parameter combinations\nfor each set of input parameters:\n    pass the inputs to the objective function and store results in the N-D array\n\n    get unique hash for the set of inputs parameters\n    look up previous results for that hash\n    if it exists:\n        load historical data\n        combine latest data with historical data\n\n    store the results using the input hash as a key\ndeduce the type of plot based on the input types\nreturn data and plot\n&amp;lt;/code&amp;gt;&amp;lt;/pre&amp;gt;\n&amp;lt;h3&amp;gt;Example Output&amp;lt;/h3&amp;gt;\n&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;https://dyson-ai.github.io/bencher/&amp;quot;&amp;gt;https://dyson-ai.github.io/bencher/&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\n"}}]}}}},{"type":"object","name":"TabPanel","id":"p1360","attributes":{"name":"Float 1D Example","title":"Float 1D Example","child":{"type":"object","name":"panel.models.layout.Column","id":"p1326","attributes":{"name":"Float 1D Example","stylesheets":["\n:host(.pn-loading.pn-arc):before, .pn-loading.pn-arc:before {\n  background-image: url(\"data:image/svg+xml;base64,PHN2ZyB4bWxucz0iaHR0cDovL3d3dy53My5vcmcvMjAwMC9zdmciIHN0eWxlPSJtYXJnaW46IGF1dG87IGJhY2tncm91bmQ6IG5vbmU7IGRpc3BsYXk6IGJsb2NrOyBzaGFwZS1yZW5kZXJpbmc6IGF1dG87IiB2aWV3Qm94PSIwIDAgMTAwIDEwMCIgcHJlc2VydmVBc3BlY3RSYXRpbz0ieE1pZFlNaWQiPiAgPGNpcmNsZSBjeD0iNTAiIGN5PSI1MCIgZmlsbD0ibm9uZSIgc3Ryb2tlPSIjYzNjM2MzIiBzdHJva2Utd2lkdGg9IjEwIiByPSIzNSIgc3Ryb2tlLWRhc2hhcnJheT0iMTY0LjkzMzYxNDMxMzQ2NDE1IDU2Ljk3Nzg3MTQzNzgyMTM4Ij4gICAgPGFuaW1hdGVUcmFuc2Zvcm0gYXR0cmlidXRlTmFtZT0idHJhbnNmb3JtIiB0eXBlPSJyb3RhdGUiIHJlcGVhdENvdW50PSJpbmRlZmluaXRlIiBkdXI9IjFzIiB2YWx1ZXM9IjAgNTAgNTA7MzYwIDUwIDUwIiBrZXlUaW1lcz0iMDsxIj48L2FuaW1hdGVUcmFuc2Zvcm0+ICA8L2NpcmNsZT48L3N2Zz4=\");\n  background-size: auto calc(min(50%, 400px));\n}",{"id":"p1006"},{"id":"p1010"},{"id":"p1004"},{"id":"p1005"}],"margin":0,"align":"start","children":[{"type":"object","name":"panel.models.layout.Column","id":"p1327","attributes":{"name":"Column11504","stylesheets":["\n:host(.pn-loading.pn-arc):before, .pn-loading.pn-arc:before {\n  background-image: url(\"data:image/svg+xml;base64,PHN2ZyB4bWxucz0iaHR0cDovL3d3dy53My5vcmcvMjAwMC9zdmciIHN0eWxlPSJtYXJnaW46IGF1dG87IGJhY2tncm91bmQ6IG5vbmU7IGRpc3BsYXk6IGJsb2NrOyBzaGFwZS1yZW5kZXJpbmc6IGF1dG87IiB2aWV3Qm94PSIwIDAgMTAwIDEwMCIgcHJlc2VydmVBc3BlY3RSYXRpbz0ieE1pZFlNaWQiPiAgPGNpcmNsZSBjeD0iNTAiIGN5PSI1MCIgZmlsbD0ibm9uZSIgc3Ryb2tlPSIjYzNjM2MzIiBzdHJva2Utd2lkdGg9IjEwIiByPSIzNSIgc3Ryb2tlLWRhc2hhcnJheT0iMTY0LjkzMzYxNDMxMzQ2NDE1IDU2Ljk3Nzg3MTQzNzgyMTM4Ij4gICAgPGFuaW1hdGVUcmFuc2Zvcm0gYXR0cmlidXRlTmFtZT0idHJhbnNm ue of sin(theta) and cos(theta) +- various types of noise.&amp;lt;/p&amp;gt;\n&amp;lt;pre&amp;gt;&amp;lt;code&amp;gt;    def bench_function(cfg: ExampleBenchCfgIn) -&amp;amp;gt; ExampleBenchCfgOut:\n        &amp;amp;quot;Takes an ExampleBenchCfgIn and returns a ExampleBenchCfgOut output&amp;amp;quot;\n        out = ExampleBenchCfgOut()\n        noise = calculate_noise(cfg)\n        offset = 0.0\n\n        postprocess_fn = abs if cfg.postprocess_fn == PostprocessFn.absolute else negate_fn\n\n        out.out_sin = postprocess_fn(offset + math.sin(cfg.theta) + noise)\n        out.out_cos = postprocess_fn(offset + math.cos(cfg.theta) + noise)\n        return out\n\nThe following examples will show how to perform parameter sweeps to characterise the behavior of the function.  The idea is that the benchmarking can be used to gain understanding of an unknown function. \n&amp;lt;/code&amp;gt;&amp;lt;/pre&amp;gt;\n"}},{"type":"object","name":"panel.models.markup.HTML","id":"p1337","attributes":{"css_classes":["markdown"],"stylesheets":["\n:host(.pn-loading.pn-arc):before, .pn-loading.pn-arc:before {\n  background-image: url(\"data:image/svg+xml;base64,PHN2ZyB4bWxucz0iaHR0cDovL3d3dy53My5vcmcvMjAwMC9zdmciIHN0eWxlPSJtYXJnaW46IGF1dG87IGJhY2tncm91bmQ6IG5vbmU7IGRpc3BsYXk6IGJsb2NrOyBzaGFwZS1yZW5kZXJpbmc6IGF1dG87IiB2aWV3Qm94PSIwIDAgMTAwIDEwMCIgcHJlc2VydmVBc3BlY3RSYXRpbz0ieE1pZFlNaWQiPiAgPGNpcmNsZSBjeD0iNTAiIGN5PSI1MCIgZmlsbD0ibm9uZSIgc3Ryb2tlPSIjYzNjM2MzIiBzdHJva2Utd2lkdGg9IjEwIiByPSIzNSIgc3Ryb2tlLWRhc2hhcnJheT0iMTY0LjkzMzYxNDMxMzQ2NDE1IDU2Ljk3Nzg3MTQzNzgyMTM4Ij4gICAgPGFuaW1hdGVUcmFuc2Zvcm0gYXR0cmlidXRlTmFtZT0idHJhbnNmb3JtIiB0eXBlPSJyb3RhdGUiIHJlcGVhdENvdW50PSJpbmRlZmluaXRlIiBkdXI9IjFzIiB2YWx1ZXM9IjAgNTAgNTA7MzYwIDUwIDUwIiBrZXlUaW1lcz0iMDsxIj48L2FuaW1hdGVUcmFuc2Zvcm0+ICA8L2NpcmNsZT48L3N2Zz4=\");\n  background-size: auto calc(min(50%, 400px));\n}",{"id":"p1006"},{"id":"p1007"},{"id":"p1004"},{"id":"p1005"}],"margin":[5,10],"align":"start","text":"&amp;lt;pre class=&amp;quot;codehilite&amp;quot;&amp;gt;&amp;lt;code class=&amp;quot;language-text&amp;quot;&amp;gt;Input Variables:\n    theta:\n        number of samples: 2\n        sample values: [0.         3.14159265]\n        units: [rad]\n        docs: Input angle\n\nConstants:\n    offset:\n        value: 0\n        units: [v]\n        docs: dc offset\n    postprocess_fn:\n        value: absolute\n        docs: Apply a postprocessing step to the data\n    noisy:\n        value: False\n        docs: Optionally add random noise to the output of the function\n    noise_distribution:\n        value: uniform\n        docs: A categorical variable describing the types of random noise\n    sigma:\n        value: 1\n        units: [v]\n        docs: The standard deviation of the noise\n\nResult Variables:\n    out_sin:\n        units: [v]\n        docs: sin of theta with some noise\n\nMeta Variables:\n    run date: 2023-09-13 12:05:46.036717\n    bench level: 2\n    use_cache: False\n    use_sample_cache: True\n    only_hash_tag: True\n    parallel: False\n    repeat:\n        number of samples: 1\n        sample values: [1]\n        units: [repeats]\n&amp;lt;/code&amp;gt;&amp;lt;/pre&amp;gt;\n\n"}}]}},{"type":"object","name":"panel.models.markup.HTML","id":"p1342","attributes":{"css_classes":["markdown"],"stylesheets":["\n:host(.pn-loading.pn-arc):before, .pn-loading.pn-arc:before {\n  background-image: url(\"data:image/svg+xml;base64,PHN2ZyB4bWxucz0iaHR0cDovL3d3dy53My5vcmcvMjAwMC9zdmciIHN0eWxlPSJtYXJnaW46IGF1dG87IGJhY2tncm91bmQ6IG5vbmU7IGRpc3BsYXk6IGJsb2NrOyBzaGFwZS1yZW5kZXJpbmc6IGF1dG87IiB2aWV3Qm94PSIwIDAgMTAwIDEwMCIgcHJlc2VydmVBc3BlY3RSYXRpbz0ieE1pZFlNaWQiPiAgPGNpcmNsZSBjeD0iNTAiIGN5PSI1MCIgZmlsbD0ibm9uZSIgc3Ryb2tlPSIjYzNjM2MzIiBzdHJva2Utd2lkdGg9IjEwIiByPSIzNSIgc3Ryb2tlLWRhc2hhcnJheT0iMTY0LjkzMzYxNDMxMzQ2NDE1IDU2Ljk3Nzg3MTQzNzgyMTM4Ij4gICAgPGFuaW1hdGVUcmFuc2Zvcm0gYXR0cmlidXRlTmFtZT0idHJhbnNmb3JtIiB0eXBlPSJyb3RhdGUiIHJlcGVhdENvdW50PSJpbmRlZmluaXRlIiBkdXI9IjFzIiB2YWx1ZXM9IjAgNTAgNTA7MzYwIDUwIDUwIiBrZX
